import React from "react";
import "./Events.css";

const Events = () => {
  return (
    <div className="outer-card">
      <h1>Evenemang</h1>
      <div className="calendar-wrapper">
        {/* Här lägger vi in Facebook-widgeten */}
        <div
          className="fb-page"
          data-href="https://www.facebook.com/KumlaSportfiske/events"
          data-tabs="events"
          data-width="100%"
          data-height="600"
          data-small-header="false"
          data-adapt-container-width="true"
          data-hide-cover="false"
          data-show-facepile="true"
        ></div>
      </div>
    </div>
  );
};

export default Events;
